import React from 'react';
import './card-list.css';

export const CardList = (props) => {
  return (
    <div className='cardlist'>
      {props.monsters.map((monsters) => {
        return <h1 key={monsters.id}>{monsters.name}</h1>;
      })}
    </div>
  );
};
